import React from "react";
import "./card.css";

function Card(props) {
  return (
    <div className="card">
      <div className="cardImg">
        <div className="cardTitleContainer">
          <h2 className="cardTitle">{props.module}</h2>
        </div>
      </div>
      <div className="cardTextContainer">
        <h2 className="cardTextTitle">Students</h2>
      </div>
      
    </div>
  );
}

export default Card;
